// Calculate the Simple Moving Average
function calcSMA(values, periods) {
    if (values.length < periods) { return 0 }

    let sum = 0
    for (let i = values.length - periods; i < values.length; i++) {
        sum = sum + values[i]
    }
    let sma = sum / periods
    return sma
}

// Calculate the average of all the numbers
function calcMean(values) {
    const mean = (values.reduce((sum, current) => sum + current)) / values.length
    return mean
}

// Calculate variance
function calcVar(values) {
    const average = calcMean(values)
    const squareDiffs = values.map((value) => {
        const diff = value - average
        return diff * diff
    });
    const variance = calcMean(squareDiffs)
    return variance
};

// Calculate stand deviation
function calcSTD(variance) {
    return Math.sqrt(variance)
}

